import './App.css';
// boootstrap
import 'bootstrap/dist/css/bootstrap.min.css';

// components
import Navbars from './Component/nav/Navbars';
import Footer from './Component/Footer/Footer'


function App() {
  return (

    <div className="App">
    <nav>
      <Navbars /> 
    </nav>
    <main>
    <footer>
      <Footer />
    </footer>
    </main>
    </div>
  );
}

export default App;
